import React from 'react';
import {
    Button,
    Row,
    Col,
    Navbar,
    Nav,
    Container
} from 'react-bootstrap';
import './HeaderButtons.css';

function HeaderButtons()
{
    return (
        <Container fluid>
            <Row className="header-mobile-buttons">
                <Col >
                    <ul className="header-mobile-buttons-list hidden-lg">
                        <li style={{ backgroundColor: "#A4B173" }}>DONATE</li>
                        <li style={{ backgroundColor: "#0D70FC" }}>GET HELP</li>
                    </ul>
                </Col>
            </Row>
        </Container>
    );
}

export default HeaderButtons;
